                <label name='username'>
                    Username:
                    <input 
                        id='username'
                        type='text' 
                        name='username'
                        placeholder='Enter Username'
                        onChange={changeHandle}
                        value={loginForm.name}
                    />
                </label>
                <label name='password'>
                    Password:
                    <input 
                        id='password'
                        type='text' 
                        name='password' 
                        placeholder='Enter Password'
                        onChange={changeHandle}
                        value={loginForm.password}
                    /> 
                </label>
            </form>
        </div>
    )
}

export default Login;
